import './App.css';
import JobList from './components/JobList';
import JobForm from './components/JobForm';
import Navbar from './components/Navbar';
import Sidebar from '.'

function App() {
  return (
    <>
    <header>
      <Navbar />
    </header>
    <body>
      <div class='MuiDrawer-root MuiDrawer-docked css-1fqw99a'>
      <Sidebar />
      </div>
      <main class="MuiBox-root css-fxbtpg">
      <JobForm />
      <JobList />
      </main>
    </body>
    </>
  );
}

export default App;
